import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (

            <header>
<center></center>
<p style={{fontFamily: 'Helvetica Neue', fontSize:'10px'}}>

<pre> {`
████████╗ █████╗ ███████╗ █████╗ ██╗     ██╗
╚══██╔══╝██╔══██╗██╔════╝██╔══██╗██║     ██║
   ██║   ███████║███████╗███████║██║     ██║
   ██║   ██╔══██║╚════██║██╔══██║██║     ██║
   ██║   ██║  ██║███████║██║  ██║███████╗██║
   ╚═╝   ╚═╝  ╚═╝╚══════╝╚═╝  ╚═╝╚══════╝╚═╝
   `}
</pre>




</p>


<div class="menu" style={{borderWidth: '0.9px', borderSize: '3px', borderRadius: '3px', borderStyle:'dashed', borderColor: 'white', fontSize:'15px' }}>
    <ul> 
        <li style={{   display: 'inline', marginLeft: '3px' }}><a href='/'style={{color:'white'}}> Home </a></li>
        <li style={{   display: 'inline', marginLeft: '3px' }}><a href='/'style={{color:'white'}}> Archive </a></li>
        <li style={{   display: 'inline', marginLeft: '3px' }}><a href='/'style={{color:'white'}}> Whoami </a></li>
    </ul>
</div>

</header>

        );
    }
}








export default Header;
